import React from "react";
import Navbar from "./Navbar";
import { BrowserRouter as Router, Link } from "react-router-dom";
import ('./Award.css');

function Award(){
    return (
        <div>
            <Navbar/>
            <div className="awardover">
                <h1 className="award">Award</h1>
                <p className="awarddes">
                    <span>Grace W. Capen Award 2023</span><br/>
                    <span>-Issued by UB Women's Club Â· May 2023</span><br/>
                    <span>-University at Buffalo</span>
                    <img src="./images/ub.png" alt="UB" className="ublogoed"/>
                    <br/>
                    <span>-This award is made to a sophomore who has completed three semesters of full-time work at the University at Buffalo and scored a GPA of 3.95 or better</span>
                </p>
                
            </div>
        </div>
    );
}

export default Award;
